const SkeletonOrders = () => {
  return (
    <div>
      <div className="container">
        <div className="line" style={{ width: '40%' }}>
          <div className="box-wrapper">
            <div className="box"></div>
            <div className="line" style={{ width: '20rem' }}></div>
            <div className="line" style={{ width: '20rem' }}></div>
          </div>
        </div>
      </div>
      <style>
        {`
            .line {
                height: 3rem;
                background-color: #eee;
                width: 100%;
                margin-bottom: 2rem;
            }

            .box-wrapper {
                display: flex;
            }

            .small-line{
                width: 30%;
            }

            .box {
                width: 15rem;
                height: 15rem;
                background-color: #eee;
                margin-right: 2rem;
            }

         `}
      </style>
    </div>
  );
};

export default SkeletonOrders;
